import React from 'react';
import { motion } from 'framer-motion';


export default function ProjectCard({p}){
return (
<motion.div className="project-card" whileHover={{ scale:1.02 }}>
<h3>{p.title}</h3>
<p>{p.description}</p>
<div className="meta">Tech: {p.tech?.join(', ')}</div>
<div className="links">
{p.liveUrl && <a href={p.liveUrl} target="_blank" rel="noreferrer">Live</a>}
{p.repoUrl && <a href={p.repoUrl} target="_blank" rel="noreferrer">Repo</a>}
</div>
</motion.div>
);
}
